import React, { useState } from 'react';
import { motion } from 'framer-motion';

const InteractiveLines: React.FC = () => {
  const [mousePosition, setMousePosition] = useState({ x: 0, y: 0 });

  // Generate positions for main elements
  const generateMainElements = () => {
    return [
      // Center cross
      { x: 50, y: 50, type: 'cross', size: 200 },
      // Four corner elements
      { x: 20, y: 20, type: 'point', size: 40 },
      { x: 80, y: 20, type: 'point', size: 40 },
      { x: 20, y: 80, type: 'point', size: 40 },
      { x: 80, y: 80, type: 'point', size: 40 },
    ];
  };

  const elements = generateMainElements();

  const handleMouseMove = (e: React.MouseEvent) => {
    const { clientX, clientY } = e;
    setMousePosition({
      x: (clientX / window.innerWidth) * 100,
      y: (clientY / window.innerHeight) * 100
    });
  };

  return (
    <div 
      className="absolute inset-0 overflow-hidden"
      onMouseMove={handleMouseMove}
    >
      <motion.div
        className="absolute top-0 left-0 w-full h-full"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 1 }}
      >
        {/* Main Elements */}
        {elements.map((element, index) => {
          const distance = Math.sqrt(
            Math.pow(element.x - mousePosition.x, 2) + 
            Math.pow(element.y - mousePosition.y, 2)
          );
          const scale = Math.max(0.8, 1.2 - distance / 100);

          if (element.type === 'cross') {
            return (
              <React.Fragment key={`cross-${index}`}>
                {/* Horizontal line */}
                <motion.div
                  className="absolute origin-center"
                  style={{
                    left: `${element.x}%`,
                    top: `${element.y}%`,
                    width: `${element.size}px`,
                    height: '3px',
                    background: 'linear-gradient(to right, #4CAF50, #8BC34A)',
                    transform: 'translate(-50%, -50%)',
                  }}
                  initial={{ scaleX: 0 }}
                  animate={{ 
                    scaleX: scale,
                    rotate: Math.sin(Date.now() * 0.001) * 5,
                  }}
                  transition={{
                    duration: 0.5,
                    repeat: Infinity,
                    repeatType: "reverse",
                    ease: "easeInOut"
                  }}
                />
                {/* Vertical line */}
                <motion.div
                  className="absolute origin-center"
                  style={{
                    left: `${element.x}%`,
                    top: `${element.y}%`,
                    width: '3px',
                    height: `${element.size}px`,
                    background: 'linear-gradient(to bottom, #4CAF50, #8BC34A)',
                    transform: 'translate(-50%, -50%)',
                  }}
                  initial={{ scaleY: 0 }}
                  animate={{ 
                    scaleY: scale,
                    rotate: Math.cos(Date.now() * 0.001) * 5,
                  }}
                  transition={{
                    duration: 0.5,
                    repeat: Infinity,
                    repeatType: "reverse",
                    ease: "easeInOut"
                  }}
                />
              </React.Fragment>
            );
          }

          return (
            <motion.div
              key={`point-${index}`}
              className="absolute rounded-full"
              style={{
                left: `${element.x}%`,
                top: `${element.y}%`,
                width: `${element.size}px`,
                height: `${element.size}px`,
                background: 'radial-gradient(circle, #4CAF50, #8BC34A)',
                transform: 'translate(-50%, -50%)',
                boxShadow: '0 0 20px rgba(76, 175, 80, 0.3)',
              }}
              initial={{ scale: 0 }}
              animate={{ 
                scale: scale,
                rotate: Math.sin(Date.now() * 0.001 + index) * 360,
              }}
              transition={{
                duration: 2,
                repeat: Infinity,
                ease: "linear"
              }}
              whileHover={{
                scale: 1.2,
                background: 'radial-gradient(circle, #2E7D32, #4CAF50)',
                boxShadow: '0 0 30px rgba(46, 125, 50, 0.5)',
                transition: { duration: 0.3 }
              }}
            />
          );
        })}

        {/* Connecting Lines */}
        {elements.slice(1).map((point, index) => (
          <motion.div
            key={`connector-${index}`}
            className="absolute origin-left"
            style={{
              left: '50%',
              top: '50%',
              width: '100%',
              height: '1px',
              background: 'linear-gradient(to right, #4CAF50, transparent)',
              transform: `rotate(${Math.atan2(
                point.y - 50,
                point.x - 50
              ) * 180 / Math.PI}deg)`,
            }}
            initial={{ scaleX: 0 }}
            animate={{ 
              scaleX: 0.5,
              opacity: 0.3,
            }}
            transition={{
              duration: 1,
              repeat: Infinity,
              repeatType: "reverse",
              ease: "easeInOut"
            }}
          />
        ))}

        {/* Mouse Trail Effect */}
        <motion.div
          className="absolute rounded-full pointer-events-none"
          style={{
            width: '150px',
            height: '150px',
            background: 'radial-gradient(circle, rgba(76, 175, 80, 0.1), transparent 70%)',
          }}
          animate={{
            x: mousePosition.x * window.innerWidth / 100 - 75,
            y: mousePosition.y * window.innerHeight / 100 - 75,
          }}
          transition={{ type: "spring", stiffness: 50, damping: 20 }}
        />
      </motion.div>
    </div>
  );
};

export default InteractiveLines;
